import React from 'react';
import { useNavigate } from 'react-router-dom';
import Header from './Header';

const TestPage = () => {
  const navigate = useNavigate();
  const chapter = localStorage.getItem('currentChapter');

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-500 to-purple-600 text-white p-6">
      <Header />
      <div className="mt-16 max-w-3xl mx-auto bg-white bg-opacity-10 rounded-lg p-6">
        <h2 className="text-3xl font-bold mb-4 text-center">Test Instructions</h2>
        <p className="mb-4">Here are some test instructions. Follow them carefully before starting.</p>
        <p className="mb-6">Ensure you have a stable internet connection and complete the test in one go.</p>
        <div className="flex justify-center">
          <button className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-6 rounded flex items-center">
            Preparing Test...
          </button>
        </div>
      </div>
    </div>
  );
};

export default TestPage;
